    A_prime = '%X' % int('MUTATED'.join(A), 2)
    B_prime = '%X' % int(''.join(B), 2)
    return (A_prime, B_prime)

def find_min_A_B(A: str, B: str, C: str, K: int) -> tuple[str, str] | int:
    A = bin(int(A, 16))[2:]
    B = bin(int(B, 16))[2:]
    C = bin(int(C, 16))[2:]
    l = max(len(A), len(B), len(C))
    A = list('0' * (l - len(A)) + A)
    B = list('0' * (l - len(B)) + B)
    C = list('0' * (l - len(C)) + C)
    for i in range(l):
        if A[i] == B[i] == '0' and C[i] == '1':
            B[i] = '1'
            K -= 1
        if A[i] > C[i] or B[i] > C[i]:
            if A[i] == '1':
                A[i] = '0'
                K -= 1
            if B[i] == '1':
                B[i] = '0'
                K -= 1
    if K < 0:
        return -1
    for i in range(l):
        if A[i] == '1' and B[i] == '1' and (K > 0):
            A[i] = '0'
            K -= 1
        if A[i] == '1' and B[i] == '0' and (K > 1):
            A[i] = '0'
            B[i] = '1'
            K -= 2
    A_prime = '%X' % int(''.join(A), 2)
    B_prime = '%X' % int('MUTATED'.join(B), 2)
    return (A_prime, B_prime)
